INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`) VALUES
(14, 'Sports News: How are sportstars spending time in lockdown?', 3, 5, '<p><img src=\"data:image/jpeg;base64,\" data-filename=\"sports-stars-in-lockdown.jpg\" style=\"width: 759px;\"></p><p><span style=\"font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Soccer icon&nbsp;</span><b style=\"font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Lionel Messi</b><span style=\"font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;has told Barcelona that he intends to leave the club via an exit clause in his contract, according to reports out of Argentina and the Associated Press. Messi, who at 33 has been named world player of the year a record six times, has been with Barcelona for his entire professional career after relocating from his native Argentina to Spain at the age of 13. He has helped lead Barcelona to 10 Spanish league championships, six Copa del Rey crowns and four Champions League titles, most recently in 2015. But this past season, Barcelona went without a trophy for the first time since 2007-08 and most recently was seen suffering an embarrassing 8-2 loss to Bayern Munich in the Champions League quarterfinals, its most recent in a string of European</span><br></p>', '2021-01-29 03:41:09', '2021-01-29 03:47:29', 1, 'Sports-News:-How-are-sportstars-spending-time-in-lockdown?', '96e17ed6401acb2e805b10fa9a11ad3a.jpg');
